export const indexableCustomEmoji = new Map<string, any>(
    customEmoji.reduce<[string, any][]>((collector, emoji) => {
        return [...collector, [emoji.name, emoji]];
    }, [])
);

export const indexableCohostPlusCustomEmoji = new Map<string, any>(
    cohostPlusCustomEmoji.reduce<[string, any][]>((collector, emoji) => {
        return [...collector, [emoji.name, emoji]];
    }, [])
);

type ParseOptions = {
    cohostPlus: boolean;
};

export const parseEmoji: Plugin<[ParseOptions], Root, void> = (options) => {
    const compiler: CompilerFunction<Root, void> = processMatches(
        EMOJI_REGEX,
        (matches, splits, node, index, parent) => {
            const els = splits.reduce<Array<Element | Text>>((collector, curr, index) => {
                const currNode: Text = {
                    type: 'text',
                    value: curr,
                };

                const pending = [...collector, currNode];

                if (index < matches.length) {
                    const emojiName = matches[index].slice(1, matches[index].length - 1);
                    let emoji = indexableCustomEmoji.get(emojiName);
                    if (!emoji && options.cohostPlus) {
                        emoji = indexableCohostPlusCustomEmoji.get(emojiName);
                    }

                    if (emoji) {
                        pending.push({
                            type: 'element',
                            tagName: 'CustomEmoji',
                            properties: {
                                name: emoji.name,
                                url: emoji.imageUrl,
                            },
                            children: [],
                        } as Element);
                    } else {
                        pending.push({
                            type: 'text',
                            value: matches[index],
                        });
                    }
                }

                return pending;
            }, [] as Array<Element | Text>);
            parent.children.splice(index, 1, ...els);
            // skip over all the new elements we just created
            return [SKIP, index + els.length];
        }
    );
    return compiler;
};
